import{_ as o,o as e,c as i,e as l}from"./app.8ef2f5c7.js";const t={},a=l('<h2 id="required-reading" tabindex="-1"><a class="header-anchor" href="#required-reading" aria-hidden="true">#</a> Required Reading</h2><p>Coolbooter allows you to dualboot any supported version of iOS on a select few of iOS device. Coolbooter is permanent, but can be removed through the Coolbooter app on the main OS.</p><p>Only the following devices are supported on iOS 5 to iOS 10:</p><ul><li>iPhone 4</li><li>iPhone 4S</li><li>iPhone 5</li><li>iPhone 5c</li><li>iPad 2</li><li>iPad 3</li><li>iPad 4</li><li>iPad mini (1st Generation)</li><li>iPod Touch 5G</li></ul><p>This guide will require that you are already jailbroken on a supported device listed above.</p><h2 id="installing-coolbooter" tabindex="-1"><a class="header-anchor" href="#installing-coolbooter" aria-hidden="true">#</a> Installing Coolbooter</h2><ol><li>Add the repo: <code><a href="https://coolbooter.com/" target="_blank">https://coolbooter.com/</a></code> using Cydia</li><li>Download and install Coolbooter</li><li>Tap <code>Install</code><ul><li>Choose any version of iOS you&#39;d like</li><li>You can choose how much storage the new partition is allocated by tapping <code>Storage</code></li></ul></li><li>Once your Coolbooter configuration is to your liking, tap <code>I&#39;m Ready</code></li><li>Follow all onscreen prompts <ul><li>We recommend you choose to jailbreak the new OS as Coolbooter-installed versions of iOS cannot be jailbroken except by Coolbooter itself</li></ul></li><li>After the Coolbooter has completed, reboot your device <ul><li>You will need to jailbreak again if you are using a semi-untethered jailbreak</li></ul></li><li>Open Coolbooter</li><li>Tap <code>Boot</code></li><li>When prompted to lock your device, lock it</li></ol><p>To reboot back into your main version of iOS, reboot.</p>',8),r=[a];function n(d,c){return e(),i("div",null,r)}var h=o(t,[["render",n],["__file","index.html.vue"]]);export{h as default};
